import * as React from 'react';

export interface ButtonProps {
  submitPrice?: any;
  updatePrice: any;
  query: any;
  price: any;
  mutateLoading: any;
}

const Button: React.SFC<ButtonProps> = ({
  children,
  submitPrice,
  updatePrice,
  query: QUERY_PRODUCT_PRICE,
  mutateLoading,
  price,
}) => {
  return (
    <button
      type="submit"
      className="btn btn-outline-primary float-right"
      // disabled={mutateLoading || price !== price ? true : false}
      onClick={() => submitPrice(updatePrice, QUERY_PRODUCT_PRICE, price)}
    >
      {children}
    </button>
  );
};

export default Button;
